(1, 'LONDON -UK', 'GB', b'1', 'LON', 'www.nero98@gmail.com', '08713769133', '+448713769033', 'You will be centrally located in London with a stay at The Royal Horseguards, just minutes from the Charing Cross and the Victoria Embankment Gardens. The hotel is known for its location and its comfort. The primary amenities at this hotel are babysitting or childcare, bar & lounge, 24-hour front desk, elevator and free WiFi. Additional amenities include restaurant ( la carte), terrace, facilities for disabled guests, non-smoking rooms, safety-deposit box, heating, ironing facilities, fireplace in lobby, tours & ticket assistance, bridal suite, car hire, currency exchange and ironing service. The Royal Horseguards accepts American Express, Diners Club, Discover, JCB International, MasterCard and Visa for payment. Pets not allowed. The hotel is recommended for groups of friends and couples.', 51.506, -0.12414, 'THE ROYAL HORSEGUARDS ', 5, 'hotel'),
