(38, 'ST JOHN\'S', 'CA', b'1', 'YYT', 'www.nero98@gmail.com', '+1 709 726-2025', '+1 709 726-4980', 'Revel in exceptional services and amenities at Sheraton Hotel Newfoundland. Steeped in history and built on the site of the old Fort William at the base of Signal Hill, our downtown St. Johns hotel blends elegance with the vibrant and colourful atmosphere of one of the oldest cities in North America. Take advantage of our premier location, whether traveling to Newfoundland for business or enjoying a relaxing vacation. Easily accessible from the St. John\'s airport, and overlooking the harbour, our pet-friendly hotel is just minutes from area attractions, boutique shopping and legendary George Street. Within our inviting hotel, you\'ll find a host of amenities waiting. Catch up on email with the complimentary Wi-Fi in Link@Sheraton. Dine in our popular restaurants, boasting creative twists on local cuisines and Iceberg Beer. Workout in our 24-hour Sheraton fitness centre or take a dip in our indoor pool. No matter what brings you here, we look forward to welcoming you to our St. John\'s, Newfoundland hotel.', 47.5709, -52.7009, 'Sheraton Hotel Newfoundland', 4, 'hotel'),
