(45, 'MADRID', 'ES', b'1', 'MAD', 'www.nero98@gmail.com', NULL, NULL, 'Hotel in the heart of Madrid. This urban hotel is located in one of the best areas from Madrid centre, on Gran Via and very next to the Plaza del Callao. It is about a place which offers to its guests a great number of recreational and cultural possibilities, as well as of entertainment and catering. In its neighbourhood are located the most famous cinemas and theaters in the entire Spain, as well as shops, bars, pubs, restaurants, snack bars, discotheques and a very interesting cultural supply. The hotel Regente is settled just a step away from the former Madrid of the Asturias, from the Royal Palace, Plaza de Oriente and the Gate of Sun. It is very well connected with the underground and bus network, and it is located at twenty kilometres far from the Barajas international airport.    Notice: The hotel has at the customers disposal a parking place (it costs 28 euros).', 40.4195, -3.70436, 'HOTEL REGENTE', 0, 'hotel'),
